	def parse(self, response):
		#Link a cada producto
		for href in response.xpath('//section[@id="results-section"]/ol[@id="searchResults"]/li/div/a/@href'):
			url = response.urljoin(href.extract())
			
			yield scrapy.Request(url, callback = self.parse_dir_contents, dont_filter = True)

		next_page = response.xpath('//a[@class="andes-pagination__link prefetch"]/@href').get()
		if next_page is not None:
			next_page = response.urljoin(next_page)
			yield scrapy.Request(next_page, callback=self.parse, dont_filter = True)


	def parse_dir_contents(self, response):
		#self.log('GETTING URL: %s'% response.url)
		items = MercadolibretotalItem()

		categoria =  response.xpath('normalize-space(/html/body/main/section[1]/nav/div[1]/ul/li[1]/a/text())').extract()
		nombre = response.xpath('normalize-space(//h1[@class="item-title__primary "]/text())').extract()
		precio = response.xpath('//span[@class="price-tag price-tag__del"]/del/span[@class="price-tag-fraction"]/text()').extract()
		descuento = response.xpath('//span[@class="price-tag"]/span[@class="price-tag-fraction"]/text()').extract()
		porcentaje = response.xpath('//*[@id="productInfo"]/fieldset[1]/div/p/text()').extract()
		vendedor = response.xpath('//div[@class="official-store-info"]/p[@class="title"]/text()').extract()
		marca = response.xpath('//ul[@class="specs-list specs-list-primary specs-structure-medium"]/li[1]/span/text()').extract()
		envio = response.xpath('//span[@class=" green"]/text()').extract()
		meses = response.xpath('normalize-space(//p[@class="payment-installments free-installments"])').extract()
		url = response.xpath('//link[@rel="canonical"]/@href').extract()

		#Imprimimos la fecha
		now = datetime.datetime.now()
		time_now = (now.year, now.month, now.day)

		items['nombre'] = nombre
		items['original'] = precio
		items['descuento'] = descuento
		items['categoria'] = categoria
		items['porcentaje'] = porcentaje
		items['marca'] = marca
		items['vendedor'] = vendedor
		items['envio'] = envio
		items['meses'] = meses
		items['url'] = url

		yield items